import { createRouter, createWebHistory, createWebHashHistory} from 'vue-router'
import LoginPage from '@/components/LoginPage.vue'

Vue.use(Router)

export default new Router({
    routes: [
        {
            path: '/login',
            component: LoginPage
        }
    ]

})
